import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart to set up the test case
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();
    await page.waitForSelector('.notification.success', { timeout: 5000 }); // Wait for confirmation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // Step 2: Open the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 }); // Wait for item to be visible in cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Step 3: Click the remove button for the first item in the cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.locator('.remove-item').first().click();

    // Step 4: Verify the cart is now empty
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    const emptyCartText = await page.locator('.empty-cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        finalCartStatus: emptyCartText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
